import { useEffect, useState } from "react";

function StudentForm(){
    const[data,setData]=useState([])
    useEffect(()=>{
        fetch("http://localhost:3008/StudentDatabase")
        .then((res)=>{
            return res.json();
        })
        .then((resp)=>{
            console.log(resp)
            setData(resp)
        })
        
    },[])
    return(
        <div className="Container">
            <div className="Card">
                <div className="Card-title"><h1>Student Database Management System</h1></div>
                <div className="Card-body">
                    <table  className="table table-bordered">
                        <thead className="text-bg-dark"></thead>
                        <tbody></tbody>
                    </table>
                </div>
            </div>
            
        </div>
    )
}
export default StudentForm;
